<script>
    //snurr yttre omloppsbana
    gsap.to(['#outerOrbit', '#sunBeams'], {
        duration: 12, 
        transformOrigin: 'center center',
        ease: 'linear',
        rotation: 360,  
        repeat: -1, 
        })

    //Snurr inre omloppsbana
    gsap.to('#innerOrbit', {
        duration: 20, 
        transformOrigin: 'center center',
        ease: 'linear',
        rotation: -360,  
        repeat: -1, 
    })

    // Färganimation yttre omloppsbana
    gsap.to('#outerOrbit', {
        fill: 'blue',         
        duration: 6,           
        yoyo: true,            
        repeat: -1,           
        ease: 'linear', 
    });

    // Färganimation inre omloppsbana
    gsap.to('#innerOrbit', {
        fill: 'orange',         
        duration: 6,           
        yoyo: true,            
        repeat: -1,           
        ease: 'linear', 
    });

    //solförstoring
    gsap.to('#sunBeams', {
        scale: 1.3,
        duration: 2,
        repeat: -1, 
        yoyo: true,
        ease: 'linear', 
    })

    //blinkande stjärna v1
    gsap.to('#star', {
        opacity: 0,
        duration: 1.2,
        repeat: -1, 
        yoyo: true,
    })

    //blinkande stjärna v2
    gsap.to('#starTwo', {
        opacity: 0,
        duration: 1,
        repeat: -1, 
        yoyo: true,
        ease: 'linear', 
    })

    //förminskad astro
    gsap.to('#astro', {
        scale: 0.8,
        duration: 1,
        repeat: -1, 
        yoyo: true,
    })

    //förstorad boogie
    gsap.to('#boogie', {
        scale: 1.2,
        duration: 1,
        repeat: -1, 
        yoyo: true,
    })

</script>
